package String;

public class characterpresentinstring {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
  String s="Rupali";
  int count=0;
  for(int i=0;i<s.length();i++) {
	  if(s.charAt(i)!=' '){
		  count++; //1 2 3 4 5 6
			  
	  }
  }
  System.out.println(count);
	}

}
